import React, { useState } from 'react';
import { useTranslation } from 'react-i18next';

const JoinUs = () => {
  const { t, i18n } = useTranslation();
  const isRTL = i18n.language === 'ar';
  const [submitted, setSubmitted] = useState(false);

  const handleSubmit = (e) => {
    const honeypot = e.target.elements._gotcha?.value;
    if (honeypot) {
      e.preventDefault();
      return;
    }
    setSubmitted(true);
  };

  return (
    <div
      className={`container ${isRTL ? 'arabic-font' : ''}`}
      style={{ direction: isRTL ? 'rtl' : 'ltr' }}
    >
      <h1 className="storybook-heading">{t('joinTitle')}</h1>
      <p>{t('joinIntro')}</p>

      {submitted && (
        <div
          style={{
            backgroundColor: '#35DAAD',
            color: 'white',
            padding: '1rem',
            textAlign: 'center',
            borderRadius: '8px',
            marginTop: '1rem',
            fontWeight: '600',
          }}
        >
          ✅ {t('joinSuccess')}
        </div>
      )}

      <form
        action="https://formspree.io/f/xnnvbwwd"
        method="POST"
        onSubmit={handleSubmit}
        style={{
          background: 'white',
          padding: '2rem',
          borderRadius: '16px',
          boxShadow: '0 4px 10px rgba(0,0,0,0.05)',
          marginTop: '2rem',
          maxWidth: '650px',
          marginInline: 'auto',
        }}
      >
        <input type="text" name="_gotcha" style={{ display: 'none' }} />

        <div className="form-floating">
          <input
            type="text"
            name="name"
            required
            placeholder={t('joinName')}
          />
          <label>{t('joinName')}</label>
        </div>

        <div className="form-floating">
          <input
            type="email"
            name="email"
            required
            placeholder={t('joinEmail')}
          />
          <label>{t('joinEmail')}</label>
        </div>

        <div className="form-floating">
          <select
            name="role"
            required
            defaultValue=""
            style={{ paddingTop: '1.2rem' }}
          >
            <option value="" disabled>
              {t('joinSelectRole')}
            </option>
            <option>{t('joinParent')}</option>
            <option>{t('joinEducator')}</option>
            <option>{t('joinNGO')}</option>
            <option>{t('joinOther')}</option>
          </select>
          <label>{t('joinRole')}</label>
        </div>

        <button type="submit" className="btn" style={{ marginTop: '1.5rem' }}>
          {t('joinNow')}
        </button>
      </form>

      <div className="card" style={{ textAlign: 'center', marginTop: '3rem' }}>
        <h3>✨ {t('joinReady')}</h3>
        <p>
          {t('joinEmailUs')}{' '}
          <a href="mailto:mydearteacherletter@gmail.com">
            mydearteacherletter@gmail.com
          </a>
        </p>
        <p>
          {t('joinFollowUs')}{' '}
          <a
            href="https://facebook.com/share/199AeuoYb9/"
            target="_blank"
            rel="noreferrer"
          >
            Facebook
          </a>{' '}
          |{' '}
          <a
            href="https://instagram.com/mydearteachermovement"
            target="_blank"
            rel="noreferrer"
          >
            Instagram
          </a>{' '}
          |{' '}
          <a
            href="https://tiktok.com/@mydearteacher42"
            target="_blank"
            rel="noreferrer"
          >
            TikTok
          </a>
        </p>
      </div>
    </div>
  );
};

export default JoinUs;
